tables.table_schema:
CREATE TABLE political_parties (
  party_id SERIAL PRIMARY KEY,
  party_name TEXT NOT NULL,
  party_ideology TEXT
);

CREATE TABLE party_memberships (
  membership_id SERIAL PRIMARY KEY,
  member_name TEXT NOT NULL,
  party_id INT REFERENCES political_parties(party_id),
  membership_start_date DATE
);

CREATE TABLE party_memberships (
    party_id INT PRIMARY KEY,
    member_id INT,
    membership_status VARCHAR(50)
);

CREATE TABLE party_affiliations (
    party_id INT PRIMARY KEY,
    party_name VARCHAR(100),
    founding_year INT
);

CREATE TABLE member_activities (
    activity_id INT PRIMARY KEY,
    member_id INT,
    activity_type VARCHAR(50),
    activity_date DATE
);

CREATE TABLE party (
    party_id INT PRIMARY KEY,
    party_name VARCHAR(255) NOT NULL,
    party_logo_url VARCHAR(255),
    party_establishment_date DATE
);

CREATE TABLE affiliation (
    affiliation_id INT PRIMARY KEY,
    affiliation_name VARCHAR(255) NOT NULL
);
